import {
    HashRouter,
    Route,
    Link,
    Switch,
    NavLink,
} from 'react-router-dom';
import * as Scroll from 'react-scroll';
import { Element, Events, animateScroll as scroll, scrollSpy, scroller } from 'react-scroll'



let HomeHeader = () => {

    // let scrollContact = ()=>{
    //     scroll
    // }
    return(
        <section className="HomeHeader">
            <div className="HomeHeader-One">

                <Link id="x" className="button" onClick="" to="/Log/Log.js">zaloguj sie</Link>
                <Link className="button" to="/">Zarejestruj sie</Link>

            </div>
            <div className="HomeHeader-Two">
                <button>start</button>
                <button>o co chodzi</button>
                <button>o nas</button>
                <button className="HomeHeader-Two_button">Fundacja i organizacje</button>
                <Link to="/Contact" spy={true} smooth={true} offset={50} duration={500}>Kontakt</Link>
            </div>
        </section>
    )
}

export default HomeHeader
